import React from 'react';
import './Header.css';

const Header = () => {
  const quit = () => {
    window.location.href = "#/login"
  };

  return (
    <div className="header">
      <div className="content">12307&nbsp;-&nbsp;火车票售票系统</div>
      <div className="quit" onClick={quit}>退出</div>
    </div>
  );
};

export default Header;
